Doris is the debut studio album by Odd Future member Earl Sweatshirt. The album was on August 20, 2013 by Tan Cressida and Columbia Records. The album follows his free-album Earl which was released in 2010 when he was sixteen. After returning from a stay in a Samoan boarding school, he began working on his debut album and signed a deal with Columbia, rather than Odd Future's Odd Future Records.

Doris features guest appearances from Domo Genesis, Frank Ocean, Casey Veggies, Vince Staples, Tyler, the Creator, RZA and Mac Miller. Production was primarily handled by Christian Rich and Sweatshirt under the pseudonym randomblackdude. Additional production came from Matt Martians, The Neptunes, RZA, Samiyam, Frank Ocean, and Tyler, The Creator. The album was supported by three singles; &quot;Chum&quot;, &quot;Woah&quot; featuring Tyler, The Creator, and &quot;Hive&quot; featuring Vince Staples and Casey Veggies.
